  [],\n\t\"revision_timestamp\": \"2016-07-27T22:23:27.723820\",\n\t\"name\": \"seney-national-wildlife-refuge-annual-narrative-report-calendar-year-1996\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report summarizes
  activities for Seney National Wildlife Refuge, Kirtlandu2019s Warbler National Wildlife
  Refuge, Harbor Island National Wildlife Refuge, Huron Islands National Wildlife
  Refuge, and Michigan Islands National Wildlife Refuge during the 1996 calendar year.
  The report begins with a summary of the yearu2019s highlights and climatic conditions.
  Land acquisition is also covered. The report includes a planning section which discusses
  research and investigations. Refuge administration is outlined; information about
  personnel, volunteer programs, funding, safety, and technical assistance is given.
  Habitat management is also covered. Subjects include wetlands, forests, fire management,
  pest control, and Farmers Home Administration Conservation Easements. The wildlife
  section of the report discusses wildlife diversity, endangered species, threatened
  species, waterfowl, marsh birds, waterbirds, shorebirds, raptors, game mammals,
  fisheries resources, wildlife propagation and stocking, marking, and banding. The
  public uses of the Refuge described in this report include outdoor classrooms, interpretive
  exhibits, hunting, fishing, trapping, wildlife observation, camping, law enforcement,
  and cooperating associations. The equipment and facilities section of the report
  provides information about new construction, rehabilitation, major maintenance,
  equipment utilization and replacement, and computer systems. Refuge brochures and
  newsletters are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
